import React from "react";
import { Link } from "react-router-dom";
function App() {
  return (
    <div id="xxx">
      <header>
        <div>
          <button>&#9776;</button>
          <Link to="/">amazona</Link>
        </div>
      </header>
    </div>
  );
}

export default App;
